
//<editor-fold desc="IMAGE URLs">
const mapURL = "data:image/jpeg;base64,";

const carURL = "data:image/png;base64,";
//</editor-fold>

export default class Manager {
    application;
    navigateEnabled;

    constructor(app, navigate) {
        if (!Manager.instance) {
            Manager.instance = this;
            this.application = app;
            this.navigateEnabled = navigate;
            Manager.instance.setMouseWheelEvents();

            const loader = PIXI.loader;
            loader.add('map', mapURL);
            loader.add('car', carURL);
            loader.load((loader, resources) => {
                // Initialise components inside the application
                Manager.instance.application.initialiseComponents();
            });

        }
        return Manager.instance;
    }



//<editor-fold desc="Mousewheel events">
    setMouseWheelEvents() {
        // Setup mousewheel event for map and current stall
        $("div#display canvas").on('mousewheel',
            function(event){
                let manager = Manager.instance;

                // If the mouse isn't hovering above the map, do nothing when scrolling
                let mousePosition = manager.application.mapContainer ? manager.application.mapContainer.getMouseRelativeToMap() : -1;
                if(!manager.application.isPositionOnMap(mousePosition)) return;


                manager.application.zoomMap(event.originalEvent.deltaY);
                manager.scaleHasBeenUpdated();

            }
        );
    }

    scaleHasBeenUpdated() {

    }

    clearMouseWheelEvents() {
        $("div#display canvas").off();
    }

//</editor-fold>



}
